from subprocess import PIPE, Popen, STDOUT

import pytest


@pytest.fixture
def call_calc():
    def _fixture(n1, sign, n2):
        p = Popen(
            ['python', 'my_first_calculator.py'],
            stdout=PIPE, stdin=PIPE, stderr=STDOUT
        )
        inp = '\n'.join([n1, sign, n2]) + '\n'
        inp = inp.encode()
        out, _ = p.communicate(inp)
        return out.decode()

    return _fixture


@pytest.fixture
def extract_result():
    def _fixture(text):
        content = text.splitlines()
        content = content[2]  # 3rd line after welcoming
        content = content.split(':')[-1]  # filter out prompts
        content = content.strip()
        return content

    return _fixture


